// src/components/CardItem.js
import React from 'react';
import { useNavigate } from 'react-router-dom';
import './CardItem.css';

const CardItem = ({ card }) => {
  const navigate = useNavigate();

  const handleEdit = () => {
    navigate(`/edit/${card.id}`);
  };

  return (
    <div className="card-item">
      <div className="card-details">
        <h3>{card.cardType === 2 ? 'Kredi Kartı' : 'Banka Kartı'}</h3>
        <p><strong>Kart Numarası:</strong> {card.cardNumber}</p>
        <p><strong>Kart Sahibi:</strong> {card.cardHolderName}</p>
        <p><strong>Banka Adı:</strong> {card.bankName}</p>
        <p><strong>Son Kullanma Tarihi:</strong> {new Date(card.expirationDate).toLocaleDateString()}</p>
        <p><strong>CVV:</strong> {card.cvv}</p>
        {card.cardType === 2 ? (
          <>
            <p><strong>Kredi Limiti:</strong> {card.creditLimit} TL</p>
            <p><strong>Kullanılabilir Bakiye:</strong> {card.availableBalance} TL</p>
            <p><strong>Minimum Ödeme:</strong> {card.minimumPayment} TL</p>
            <p><strong>Faiz Oranı:</strong> {card.interestRate} %</p>
            <p><strong>Ekstre Tarihi:</strong> {new Date(card.billingDate).toLocaleDateString()}</p>
            <p><strong>Son Ödeme Tarihi:</strong> {new Date(card.dueDate).toLocaleDateString()}</p>
            <p><strong>Taksit Desteği:</strong> {card.installments ? 'Var' : 'Yok'}</p>
          </>
        ) : (
          <>
            <p><strong>Hesap Numarası:</strong> {card.accountNumber}</p>
            <p><strong>IBAN:</strong> {card.IBAN}</p>
            <p><strong>Bakiye:</strong> {card.balance} TL</p>
            <p><strong>Günlük Para Çekme Limiti:</strong> {card.withdrawalLimit} TL</p>
            <p><strong>Temassız Ödeme Desteği:</strong> {card.isContactless ? 'Var' : 'Yok'}</p>
          </>
        )}
      </div>
      <button className="edit-button" onClick={handleEdit}>
        Düzenle
      </button>
    </div>
  );
};

export default CardItem;
